comments.message:
This function is a bit dangerous because it operates on a single variable (JsonDoc).

I think this would be better:

    static le_result_t CreateJsonDocument(
        char *buffer,
        size_t bufferSize,
        const char *name,
        const char *path,
        bool isReadOnce,
        const char *unit)
    {
        int res = snprintf(buffer, bufferSize, "...", name, path, isReadOnce ? "true" : "false", unit);
        if (res < 0)
        {
            return LE_FAULT;
        }
        else if (res >= bufferSize)
        {
            return LE_OVERFLOW;
        }
        return LE_OK;
    }

You can remove some nesting:

    if (result != LE_OK)
